import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">

        <img src="{logo}" className="App-logo"/>

        <h1 className="h4">X</h1>

      </div>
    );
  }
}

export default App;
